import React from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, createTheme, CssBaseline } from '@mui/material';

import { AuthProvider } from './context/AuthContext';
import ProtectedRoute from './components/Common/ProtectedRoute';

import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import ProdutosList from './pages/Produtos/ProdutosList';
import VendasList from './pages/Vendas/VendasList';
import NovaVenda from './pages/Vendas/NovaVenda';
import UsuariosList from './pages/Usuarios/UsuariosList';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />

      {/* AuthProvider deve ficar FORA do BrowserRouter */}
      <AuthProvider>
        <BrowserRouter>
          <Routes>

            {/* LOGIN */}
            <Route path="/login" element={<Login />} />

            {/* DASHBOARD */}
            <Route
              path="/dashboard"
              element={
                <ProtectedRoute>
                  <Dashboard />
                </ProtectedRoute>
              }
            />

            {/* PRODUTOS */}
            <Route
              path="/produtos"
              element={
                <ProtectedRoute>
                  <ProdutosList />
                </ProtectedRoute>
              }
            />

            {/* VENDAS */}
            <Route
              path="/vendas"
              element={
                <ProtectedRoute roles={['ADMIN', 'VENDAS']}>
                  <VendasList />
                </ProtectedRoute>
              }
            />

            {/* CRIAR VENDA */}
            <Route
              path="/vendas/nova"
              element={
                <ProtectedRoute roles={['ADMIN', 'VENDAS']}>
                  <NovaVenda />
                </ProtectedRoute>
              }
            />

            {/* USUÁRIOS */}
            <Route
              path="/usuarios"
              element={
                <ProtectedRoute roles={['ADMIN']}>
                  <UsuariosList />
                </ProtectedRoute>
              }
            />

            {/* ROTA PADRÃO */}
            <Route path="/" element={<Navigate to="/dashboard" replace />} />

          </Routes>
        </BrowserRouter>
      </AuthProvider>

    </ThemeProvider>
  );
}

export default App;
